import React from "react";

const MovieCard = ({ movie }) => {
    return (
        <div>
            <div className="movie">
                <p>{ props.Year  }</p>
            </div>

            <img
                src={
                    props.Poster !== 'N/A'
                        ? props.Poster
                        : 'https://via.placeholder.com/400'
                }
                alt={props.Title}
            />

            <div>
                <span>{props.Type}</span>
                <h3>{props.Title}</h3>
            </div>
        </div>
    )
}

export default MovieCard;
